    public void getEcllipseClipping() {
        _clipLines = new ArrayList<>();

        //---- Generate border with ellipse
        double x0 = 0;
        double y0 = 0;
        double a = 0;
        double b = 0;
        double c = 0;
        boolean ifX = false;
        x0 = this.getWidth() / 2;
        y0 = this.getHeight() / 2;
        double dist = 0;
        dist = 100;
        a = x0 - dist;
        b = y0 - dist / 2;
        if (a > b) {
            ifX = true;
        } else {
            ifX = false;
            c = a;
            a = b;
            b = c;
        }

        int i = 0;
        int n = 0;
        n = 100;
        double nx = 0;
        double x1 = 0;
        double y1 = 0;
        double ytemp = 0;
        List<PointD> pList = new ArrayList<>();
        List<PointD> pList1 = new ArrayList<>();
        PointD aPoint;
        nx = (x0 * 2 - dist * 2) / n;
        for (i = 1; i <= n; i++) {
            x1 = dist + nx / 2 + (i - 1) * nx;
            if (ifX) {
                ytemp = Math.sqrt((1 - Math.pow((x1 - x0), 2) / Math.pow(a, 2)) * Math.pow(b, 2));
                y1 = y0 + ytemp;
                aPoint = new PointD();
                aPoint.X = x1;
                aPoint.Y = y1;
                pList.add(aPoint);
                aPoint = new PointD();
                aPoint.X = x1;
                y1 = y0 - ytemp;
                aPoint.Y = y1;
                pList1.add(aPoint);
            } else {
                ytemp = Math.sqrt((1 - Math.pow((x1 - x0), 2) / Math.pow(b, 2)) * Math.pow(a, 2));
                y1 = y0 + ytemp;
                aPoint = new PointD();
                aPoint.X = x1;
                aPoint.Y = y1;
                pList1.add(aPoint);
                aPoint = new PointD();
                aPoint.X = x1;
                y1 = y0 - ytemp;
                aPoint.Y = y1;
                pList1.add(aPoint);
            }
        }

        aPoint = new PointD();
        if (ifX) {
            aPoint.X = x0 - a;
        } else {
            aPoint.X = x0 - b;
        }
        aPoint.Y = y0;
        List<PointD> cLine = new ArrayList<>();
        cLine.add(aPoint);
        for (i = 0; i < pList.size(); i++) {
            cLine.add(pList.get(i));
        }
        aPoint = new PointD();
        aPoint.Y = y0;
        if (ifX) {
            aPoint.X = x0 + a;
        } else {
            aPoint.X = x0 + b;
        }
        cLine.add(aPoint);
        for (i = pList1.size() - 1; i >= 0; i += -1) {
            cLine.add(pList1.get(i));
        }
        cLine.add(cLine.get(0));
        _clipLines.add(cLine);
    }

    public void clockwiseClipLine(){
        for (List< PointD> cLine : _clipLines) {
            Contour.clockwisePointList(cLine);
        }
    }

    public void clipLines() {
        _clipContourLines = Collections.synchronizedList(new ArrayList<>());
        _clipLines.parallelStream().forEach((cLine)->{
            _clipContourLines.addAll(Contour.clipPolylines(_contourLines, cLine));
        });
    }

    public void clipPolygons() {
        _clipContourPolygons = Collections.synchronizedList(new ArrayList<>());
        _clipLines.parallelStream().forEach((cLine)->{
            _clipContourPolygons.addAll(Contour.clipPolygons(_contourPolygons, cLine));
        });
        System.out.println("_clipContourPolygons");
    }

