    public void createColors(Color sColor, Color eColor, int cNum) {
        _colors = new Color[cNum];
        int sR = 0;
        int sG = 0;
        int sB = 0;
        int eR = 0;
        int eG = 0;
        int eB = 0;
        int rStep = 0;
        int gStep = 0;
        int bStep = 0;
        int i = 0;

        sR = sColor.getRed();
        sG = sColor.getGreen();
        sB = sColor.getBlue();
        eR = eColor.getRed();
        eG = eColor.getGreen();
        eB = eColor.getBlue();
        rStep = (int) ((eR - sR) / cNum);
        gStep = (int) ((eG - sG) / cNum);
        bStep = (int) ((eB - sB) / cNum);
        for (i = 0; i < _colors.length; i++) {
            int r = sR + i * rStep;
            int g = sG + i * gStep;
            int b = sB + i * bStep;
            _colors[i] = new Color(r, g, b);
        }
    }

